/*
Very often the CUR does not have important instance specs embedded in the rows.
*/

drop table if exists cloudstats.cloudstats_dim_instance_specs cascade;

create table cloudstats.cloudstats_dim_instance_specs (
  instance_name varchar,
  instance_type varchar primary key,
  instance_memory varchar,
  vcpu varchar,
  gpu varchar,
  processor_name varchar,
  instance_storage varchar,
  network_performance varchar,
  instance_io varchar,
  product_code varchar,
  instance_spec varchar,
  processor_vendor varchar,
  processor_line varchar,
  compute_class varchar
);

;
